// App.tsx
import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { TabRoutes } from './src/routes/TabNavigatortsx';

export default function App() {
    return (
        <NavigationContainer>
            <TabRoutes />
        </NavigationContainer>
    );
}
